def log_debug(msg):
    logging.debug(msg)


def log_info(msg):
    logging.info(msg)


def log_warn(msg):
    logging.warning(msg)


def log_error(msg):
    logging.error(msg)


class Spawner:
    def __init__(
        self,
        sim: jps.Simulation,
        dt: int,
        stop_at: int,
        points: list[tuple[float, float]],
        parameter_profile_id: int,
        journey_id: int,
    ):
        self.sim = sim
        self.dt = dt
        self.stop_at = stop_at
        self.points = points
        self.agent_parameters = jps.VelocityModelAgentParameters()
        self.agent_parameters.journey_id = journey_id
        self.agent_parameters.profile_id = parameter_profile_id
        self.agent_parameters.orientation = (1.0, 0.0)

    def spawn(self, iteration: int):
        if iteration > self.stop_at:
            return
        if iteration % self.dt == 0:
            for p in self.points:
                if len(list(self.sim.agents_in_range(p, 0.6))) == 0:
                    self.agent_parameters.position = p
                    self.sim.add_agent(self.agent_parameters)


def create_journeys(sim: jps.Simulation):
    exits = [
        [(1107, -7.6), (1104, -6.29), (1104, -4.24), (1107.87, -5.68)],
        [
            (1038.9, 2425.24),
            (1037.51, 2426.48),
            (1042.61, 2433.24),
            (1044.12, 2432.12),
        ],
    ]

    def make(exit, sim):
        journey = jps.JourneyDescription()
        journey.add_exit(exit)
        return sim.add_journey(journey)

    return [make(e, sim) for e in exits]


def main():
    logging.basicConfig(
        level=logging.DEBUG, format="%(levelname)s : %(message)s"
    )
    jps.set_debug_callback(log_debug)
    jps.set_info_callback(log_info)
    jps.set_warning_callback(log_warn)
    jps.set_error_callback(log_error)

    geo = shapely.from_wkt(wkt)

    geo_builder = jps.GeometryBuilder()
    geo_builder.add_accessible_area(geo.geoms[0].exterior.coords[:-1])
    geometry = geo_builder.build()

    model_builder = jps.VelocityModelBuilder(
        a_ped=8, d_ped=0.1, a_wall=5, d_wall=0.02
    )
    profile_id = 3
    model_builder.add_parameter_profile(
        id=profile_id, time_gap=1, tau=0.5, v0=1.2, radius=0.3
    )

    model = model_builder.build()

    simulation = jps.Simulation(model=model, geometry=geometry, dt=0.01)

    journeys = create_journeys(simulation)
    spawners = [
        Spawner(
            simulation,
            200,
            90000,
            [
                (72.29, 1220.56),
                (71.92, 1219.36),
                (-4, 1033.79),
                (-4.33, 1034.54),
                (-4.82, 1035.21),
                (1455.15, 534),
                (1456.12, 535),
            ],
            profile_id,
            journeys[0],
        ),
        Spawner(
            simulation,
            260,
            90000,
            [
                (72.29, 1220.56),
                (71.92, 1219.36),
                (-4, 1033.79),
                (-4.33, 1034.54),
                (-4.82, 1035.21),
                (1455.15, 534),
                (1456.12, 535),
            ],
            profile_id,
            journeys[1],
        ),
    ]

    writer = SqliteTrajectoryWriter(pathlib.Path("example5_out.sqlite"))
    writer.begin_writing(5, to_wkt(geo, rounding_precision=-1))
    for s in spawners:
        s.spawn(simulation.iteration_count())
    while simulation.agent_count() > 0:
        try:
            if simulation.iteration_count() % 20 == 0:
                writer.write_iteration_state(simulation)
            for s in spawners:
                s.spawn(simulation.iteration_count())
            before = time.perf_counter_ns()
            simulation.iterate()
            duration = time.perf_counter_ns() - before
            print(
                f"Iteration: {simulation.iteration_count():3.0f} / Time taken: {duration / 1000000}ms",
                end="\r",
            )
        except KeyboardInterrupt:
            writer.end_writing()
            print("CTRL-C Recieved! Shuting down")
            sys.exit(1)

    writer.end_writing()


if __name__ == "__main__":
    main()
